import "../assets/css/main.css";
import { Link } from 'react-router-dom';
import HomeServiceBox from "../includes/homeServiceBox/homeServiceBox";
import servImg1 from "../assets/images/service/img1.jpg"
import servImg2 from "../assets/images/service/"

function HomeService(){
    return (
        <section id="homeService">
            <article className="container">
                <article className="homeServiceTitle">
                    <h2>Our Treatments</h2>
                    <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Id accusamus molestias eveniet. Dignissimos, dolorum est.</p>
                </article>
                <article className="homeServiceMain">
                    <HomeServiceBox link="/ChronicPain" servImg={servImg1} servTitle="Chronic Pain" servDesc="Lorem ipsum, dolor sit amet consectetur adipisicing elit."></HomeServiceBox>
                    <HomeServiceBox link="/ChildhoodDisabilities" servImg="" servTitle="Childhood Disabilities" servDesc="Lorem ipsum, dolor sit amet consectetur adipisicing elit."></HomeServiceBox>
                    <HomeServiceBox link="/MentalBehaviouralHealth" servImg="" servTitle="Mental & Behavioural Health" servDesc="Lorem ipsum, dolor sit amet consectetur adipisicing elit."></HomeServiceBox>
                    <HomeServiceBox link="/ChronicDiseaseManagement" servImg="" servTitle="Chronic Disease Management" servDesc="Lorem ipsum, dolor sit amet consectetur adipisicing elit."></HomeServiceBox>
                </article>
            </article>
        </section>
    );
}

export default HomeService;
